import React from 'react';
import styled from "styled-components";
import * as ReactBootstrap from 'react-bootstrap';
import NASA_logo from '../../img/NASA_logo.png';
import '../../App.css';
import '../../styles/home.css';

export default function NavBar() {
    return (
        <div className="Navbar">
               <ReactBootstrap.Navbar className="Navbar" expand="md" variant="dark">
            <ReactBootstrap.Navbar.Brand href="#home"> <a href="/"><img src={NASA_logo} class="Logo_Nasa" width="180" height="150" /></a></ReactBootstrap.Navbar.Brand>
            <ReactBootstrap.Navbar.Toggle />
            <ReactBootstrap.Navbar.Collapse >
              <Navbar>
              <ReactBootstrap.Nav className="mr-auto" >
                <ReactBootstrap.Nav.Link href="/" className="Button_Home_Nav">Inicio</ReactBootstrap.Nav.Link>
                <ReactBootstrap.Nav.Link href="AnyPhoto" className="Button_Home_Nav">Imagem Astron√≥mica do Dia</ReactBootstrap.Nav.Link>
              </ReactBootstrap.Nav>
              </Navbar>
            </ReactBootstrap.Navbar.Collapse>
          </ReactBootstrap.Navbar>
        </div>
    )
}
const Navbar = styled.div`
    padding-left: 25%;
`;
